INSERT INTO `submission` VALUES ('1552881110559WnxYLKN53R6vEDfIA2zT', 'chutich', 'S10003', 2, '03:51:50 18-03-2019', '10', 'right,right,right,right,right,right,right,right,right,right', 'text/x-java', 'import java.util.Scanner;\nclass Main{\n  public static void main(String[] args){\n    Scanner sc = new Scanner(System.in);\n    int a = sc.nextInt();\n    if(a%3 == 0){\n      System.out.print(\"yes\");\n    }else{\n      System.out.print(\"no\");\n    }\n  }\n}');
INSERT INTO `submission` VALUES ('1552984866247vwgHxypPbCOe7uzaNIGK', 'chutich', 'P0002', 1, '08:41:06 19-03-2019', '10', 'right,right,right,right,right,right,right,right,right,right', 'text/x-java', 'import java.util.Scanner;\n\nclass Main{\n\n	public static void main(String[] args){\n		Scanner sc = new Scanner(System.in);\n		int a = sc.nextInt();\n		if(isPrimeNumber(a)){\n			System.out.print(\"yes\");\n		}else{\n			System.out.print(\"no\");\n		}\n		\n		\n	\n	}\n	\n	public static boolean isPrimeNumber(int n) {\n        // so nguyen n < 2 khong phai la so nguyen to\n        if (n < 2) {\n            return false;\n        }\n        // check so nguyen to khi n >= 2\n        int squareRoot = (int) Math.sqrt(n);\n        for (int i = 2; i <= squareRoot; i++) {\n            if (n % i == 0) {\n                return false;\n            }\n        }\n        return true;\n    }\n\n	\n}');
INSERT INTO `submission` VALUES ('1552984873131noHJG0pSdgaNwhceFvkR', 'chutich', 'P0002', 1, '08:41:13 19-03-2019', '10', 'right,right,right,right,right,right,right,right,right,right', 'text/x-java', 'import java.util.Scanner;\n\nclass Main{\n\n	public static void main(String[] args){\n		Scanner sc = new Scanner(System.in);\n		int a = sc.nextInt();\n		if(isPrimeNumber(a)){\n			System.out.print(\"yes\");\n		}else{\n			System.out.print(\"no\");\n		}\n		\n		\n	\n	}\n	\n	public static boolean isPrimeNumber(int n) {\n        // so nguyen n < 2 khong phai la so nguyen to\n        if (n < 2) {\n            return false;\n        }\n        // check so nguyen to khi n >= 2\n        int squareRoot = (int) Math.sqrt(n);\n        for (int i = 2; i <= squareRoot; i++) {\n            if (n % i == 0) {\n                return false;\n            }\n        }\n        return true;\n    }\n\n	\n}');
